import React, { useState } from 'react';
import styled from 'styled-components';

const PortfolioSection = styled.section`
  padding: 6rem 2rem;
  background-color: ${props => props.theme.colors.background};
`;

const Container = styled.div`
  max-width: 1200px;
  margin: 0 auto;
`;

const Title = styled.h2`
  font-family: ${props => props.theme.fonts.primary};
  font-size: 2.5rem;
  color: ${props => props.theme.colors.primary};
  text-align: center;
  margin-bottom: 3rem;
`;

const FilterButtons = styled.div`
  display: flex;
  justify-content: center;
  gap: 1rem;
  margin-bottom: 3rem;
  flex-wrap: wrap;
`;

const FilterButton = styled.button`
  background: none;
  border: 2px solid ${props => props.theme.colors.primary};
  padding: 0.5rem 1.5rem;
  font-family: ${props => props.theme.fonts.secondary};
  color: ${props => props.active ? 'white' : props.theme.colors.primary};
  background-color: ${props => props.active ? props.theme.colors.primary : 'transparent'};
  cursor: pointer;
  transition: all 0.3s ease;
  
  &:hover {
    background-color: ${props => props.theme.colors.primary};
    color: white;
  }
`;

const ProjectsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(300px, 1fr));
  gap: 2rem;
`;

const ProjectCard = styled.div`
  position: relative;
  overflow: hidden;
  border-radius: 10px;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
  
  &:hover {
    .overlay {
      opacity: 1;
    }
  }
`;

const ProjectImage = styled.img`
  width: 100%;
  height: 250px;
  object-fit: cover;
`;

const ProjectOverlay = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  background: rgba(0, 0, 0, 0.8);
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  opacity: 0;
  transition: opacity 0.3s ease;
  padding: 1.5rem;
  color: white;
`;

const ProjectTitle = styled.h3`
  font-family: ${props => props.theme.fonts.primary};
  font-size: 1.5rem;
  margin-bottom: 1rem;
  text-align: center;
`;

const ProjectDescription = styled.p`
  font-family: ${props => props.theme.fonts.secondary};
  text-align: center;
  margin-bottom: 1rem;
`;

const projects = [
  {
    id: 1,
    title: "Site E-commerce",
    description: "Une plateforme de vente en ligne moderne et responsive",
    image: "/images/portfolio/ecommerce.jpg",
    category: "web"
  },
  {
    id: 2,
    title: "Application Mobile",
    description: "Application de suivi de fitness pour iOS et Android",
    image: "/images/portfolio/mobile.jpg",
    category: "mobile"
  },
  {
    id: 3,
    title: "Design UI/UX",
    description: "Interface utilisateur pour une application de productivitÃ©",
    image: "/images/portfolio/design.jpg",
    category: "design"
  }
];

const Portfolio = () => {
  const [activeFilter, setActiveFilter] = useState('tous');
  
  const filteredProjects = activeFilter === 'tous'
    ? projects
    : projects.filter(project => project.category === activeFilter);

  return (
    <PortfolioSection id="portfolio">
      <Container>
        <Title>Notre Portfolio</Title>
        <FilterButtons>
          <FilterButton 
            active={activeFilter === 'tous'} 
            onClick={() => setActiveFilter('tous')}
          >
            Tous
          </FilterButton>
          <FilterButton 
            active={activeFilter === 'web'} 
            onClick={() => setActiveFilter('web')}
          >
            Web
          </FilterButton>
          <FilterButton 
            active={activeFilter === 'mobile'} 
            onClick={() => setActiveFilter('mobile')}
          >
            Mobile
          </FilterButton>
          <FilterButton 
            active={activeFilter === 'design'} 
            onClick={() => setActiveFilter('design')}
          >
            Design
          </FilterButton>
        </FilterButtons>
        <ProjectsGrid>
          {filteredProjects.map(project => (
            <ProjectCard key={project.id}>
              <ProjectImage src={project.image} alt={project.title} />
              <ProjectOverlay className="overlay">
                <ProjectTitle>{project.title}</ProjectTitle>
                <ProjectDescription>{project.description}</ProjectDescription>
              </ProjectOverlay>
            </ProjectCard>
          ))}
        </ProjectsGrid>
      </Container>
    </PortfolioSection>
  );
};

export default Portfolio;
